# -*- coding: utf-8 -*-
import json
import scipy.stats


def read_data(file_path):
    with open(file_path) as json_file:
        raw_data = json.load(json_file)
    times = []
    for i in raw_data:
        times.append(i['execTime'])
    return times


# 计算均值
def cal_mean(data):
    return sum(data) / len(data)


# 计算方差
def cal_variance(data):
    n = len(data)
    m = cal_mean(data)
    r = 0.0
    for v in data:
        r += ((v - m) ** 2) / n
    return r


# 计算样本方差
def cal_sample_variance(data):
    n = len(data)
    return cal_variance(data) * n / (n - 1)


# 计算t值
def cal_t_value(e, m, s, n):
    # TODO: 问题一：已知样本均值e，目标均值m，样本方差s，样本数量n，求t值
    t = (e - m) / ((s / n) ** (1/2))

    return t


# 计算chi-square值
def cal_chi_square_value(s, r, n):
    # TODO: 问题二：已知样本方差s，目标方差r，样本数量n，求chi值
    chi = (n - 1) * s / r

    return chi


